CREATE TABLE superstore(
   "Row ID"        INTEGER  NOT NULL PRIMARY KEY 
  ,"Order ID"      VARCHAR(14) NOT NULL
  ,"Order Date"    DATE 
  ,"Ship Date"     DATE 
  ,"Ship Mode"     VARCHAR(14) NOT NULL
  ,"Customer ID"   VARCHAR(8) NOT NULL
  ,"Customer Name" VARCHAR(18) NOT NULL
  ,Segment         VARCHAR(11) NOT NULL
  ,Country         VARCHAR(13) NOT NULL
  ,City            VARCHAR(15) NOT NULL
  ,State           VARCHAR(14) NOT NULL
  ,"Postal Code"   INTEGER  NOT NULL
  ,Region          VARCHAR(7) NOT NULL
  ,"Product ID"    VARCHAR(15) NOT NULL
  ,Category        VARCHAR(15) NOT NULL
  ,SubCategory     VARCHAR(11) NOT NULL
  ,"Product Name"  VARCHAR(98) NOT NULL
  ,Sales           NUMERIC(8,4)
  ,Quantity        INTEGER 
  ,Discount        NUMERIC(4,2) NOT NULL
  ,Profit          NUMERIC(9,4) NOT NULL
);
